CREATE TABLE `otroci` (
  `oid` int(11) NOT NULL AUTO_INCREMENT,
  `ime` varchar(45) NOT NULL,
  `priimek` varchar(45) NOT NULL,
  `starost` varchar(45) NOT NULL,
  `telefon` varchar(45) DEFAULT NULL,
  `naslov` varchar(45) DEFAULT NULL,
  `posta` varchar(45) DEFAULT NULL,
  `opombe` text NOT NULL,
  `Placano` tinyint(1) DEFAULT '0',
  `Prijavnica` tinyint(1) DEFAULT '0',
  `majica` tinyint(1) DEFAULT '0',
  `izlet` tinyint(1) DEFAULT '0',
  `bazen` tinyint(1) DEFAULT '0',
  `extra` tinyint(1) DEFAULT '0',
  `slika` longblob,
  `sid` int(11) DEFAULT '0',
  PRIMARY KEY (`oid`),
  KEY `sid_idx` (`sid`),
  CONSTRAINT `otroci_sid` FOREIGN KEY (`sid`) REFERENCES `skupine` (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=125 DEFAULT CHARSET=utf8;
